import NavbarComp from "./partials/Navbar";
import HeaderPresentation from "./HeaderPresentation";

function App() {
  return (
    <>
    <header>
      <div className="App">
        <NavbarComp />
        <HeaderPresentation />
      </div>
    </header>
    </>
  );
}

export default App;
